import React from 'react';
import '../styles/AboutPage.css';

function AboutPage() {
    return (
        <div className="page-content">
            <h2>О нас</h2>
            <p>
                Добро пожаловать в наше приложение с рецептами! Мы стремимся поделиться с вами лучшими рецептами со всего мира.
            </p>
            <p>
                Наша цель — помочь вам найти вдохновение для приготовления вкусных блюд дома. Присоединяйтесь к нам и начните свое кулинарное путешествие уже сегодня!
            </p>
        </div>
    );
}

export default AboutPage;
